    "Are you sure you want to delete this post?": "\u023a\u0279\u01dd \u028e\u00f8n sn\u0279\u01dd \u028e\u00f8n \u028d\u0250n\u0287 \u0287\u00f8 d\u01ddl\u01dd\u0287\u01dd \u0287\u0265\u1d09s d\u00f8s\u0287?",
    "Are you sure you want to delete this response?": "\u023a\u0279\u01dd \u028e\u00f8n sn\u0279\u01dd \u028e\u00f8n \u028d\u0250n\u0287 \u0287\u00f8 d\u01ddl\u01dd\u0287\u01dd \u0287\u0265\u1d09s \u0279\u01ddsd\u00f8ns\u01dd?",
