    "Are you sure you want to delete {email} from the library \u201c{container}\u201d?": "\u023a\u0279\u01dd \u028e\u00f8n sn\u0279\u01dd \u028e\u00f8n \u028d\u0250n\u0287 \u0287\u00f8 d\u01ddl\u01dd\u0287\u01dd {email} \u025f\u0279\u00f8\u026f \u0287\u0265\u01dd l\u1d09b\u0279\u0250\u0279\u028e \u201c{container}\u201d?",
    "Are you sure you want to remove this transcript?": "\u023a\u0279\u01dd \u028e\u00f8n sn\u0279\u01dd \u028e\u00f8n \u028d\u0250n\u0287 \u0287\u00f8 \u0279\u01dd\u026f\u00f8\u028c\u01dd \u0287\u0265\u1d09s \u0287\u0279\u0250ns\u0254\u0279\u1d09d\u0287?",
    "Are you sure you want to remove this video from the list?": "\u023a\u0279\u01dd \u028e\u00f8n sn\u0279\u01dd \u028e\u00f8n \u028d\u0250n\u0287 \u0287\u00f8 \u0279\u01dd\u026f\u00f8\u028c\u01dd \u0287\u0265\u1d09s \u028c\u1d09d\u01dd\u00f8 \u025f\u0279\u00f8\u026f \u0287\u0265\u01dd l\u1d09s\u0287?",
    "Are you sure you want to restrict {email} access to \u201c{container}\u201d?": "\u023a\u0279\u01dd \u028e\u00f8n sn\u0279\u01dd \u028e\u00f8n \u028d\u0250n\u0287 \u0287\u00f8 \u0279\u01dds\u0287\u0279\u1d09\u0254\u0287 {email} \u0250\u0254\u0254\u01ddss \u0287\u00f8 \u201c{container}\u201d?",
    "Are you sure you want to revert to the last published version of the unit? You cannot undo this action.": "\u023a\u0279\u01dd \u028e\u00f8n sn\u0279\u01dd \u028e\u00f8n \u028d\u0250n\u0287 \u0287\u00f8 \u0279\u01dd\u028c\u01dd\u0279\u0287 \u0287\u00f8 \u0287\u0265\u01dd l\u0250s\u0287 dnbl\u1d09s\u0265\u01ddd \u028c\u01dd\u0279s\u1d09\u00f8n \u00f8\u025f \u0287\u0265\u01dd nn\u1d09\u0287? \u024e\u00f8n \u0254\u0250nn\u00f8\u0287 nnd\u00f8 \u0287\u0265\u1d09s \u0250\u0254\u0287\u1d09\u00f8n.",
    "Are you sure you want to select this session?": "\u023a\u0279\u01dd \u028e\u00f8n sn\u0279\u01dd \u028e\u00f8n \u028d\u0250n\u0287 \u0287\u00f8 s\u01ddl\u01dd\u0254\u0287 \u0287\u0265\u1d09s s\u01ddss\u1d09\u00f8n?",
    "Are you sure you want to unenroll from the purchased course {courseName} ({courseNumber})?": "\u023a\u0279\u01dd \u028e\u00f8n sn\u0279\u01dd \u028e\u00f8n \u028d\u0250n\u0287 \u0287\u00f8 nn\u01ddn\u0279\u00f8ll \u025f\u0279\u00f8\u026f \u0287\u0265\u01dd dn\u0279\u0254\u0265\u0250s\u01ddd \u0254\u00f8n\u0279s\u01dd {courseName} ({courseNumber})?",
    "Are you sure you want to unenroll from the verified {certNameLong}  track of {courseName}  ({courseNumber})?": "\u023a\u0279\u01dd \u028e\u00f8n sn\u0279\u01dd \u028e\u00f8n \u028d\u0250n\u0287 \u0287\u00f8 nn\u01ddn\u0279\u00f8ll \u025f\u0279\u00f8\u026f \u0287\u0265\u01dd \u028c\u01dd\u0279\u1d09\u025f\u1d09\u01ddd {certNameLong}  \u0287\u0279\u0250\u0254\u029e \u00f8\u025f {courseName}  ({courseNumber})?",
    "Are you sure you want to unenroll from the verified {certNameLong} track of {courseName} ({courseNumber})?": "\u023a\u0279\u01dd \u028e\u00f8n sn\u0279\u01dd \u028e\u00f8n \u028d\u0250n\u0287 \u0287\u00f8 nn\u01ddn\u0279\u00f8ll \u025f\u0279\u00f8\u026f \u0287\u0265\u01dd \u028c\u01dd\u0279\u1d09\u025f\u1d09\u01ddd {certNameLong} \u0287\u0279\u0250\u0254\u029e \u00f8\u025f {courseName} ({courseNumber})?",
    "Are you sure you want to unenroll from {courseName} ({courseNumber})?": "\u023a\u0279\u01dd \u028e\u00f8n sn\u0279\u01dd \u028e\u00f8n \u028d\u0250n\u0287 \u0287\u00f8 nn\u01ddn\u0279\u00f8ll \u025f\u0279\u00f8\u026f {courseName} ({courseNumber})?",
    "Are you sure you want to unenroll from {courseName} ({courseNumber})? You will be refunded the amount you paid.": "\u023a\u0279\u01dd \u028e\u00f8n sn\u0279\u01dd \u028e\u00f8n \u028d\u0250n\u0287 \u0287\u00f8 nn\u01ddn\u0279\u00f8ll \u025f\u0279\u00f8\u026f {courseName} ({courseNumber})? \u024e\u00f8n \u028d\u1d09ll b\u01dd \u0279\u01dd\u025fnnd\u01ddd \u0287\u0265\u01dd \u0250\u026f\u00f8nn\u0287 \u028e\u00f8n d\u0250\u1d09d.",
    "Are you sure you wish to delete this item. It cannot be reversed!\n\nAlso any content that links/refers to this item will no longer work (e.g. broken images and/or links)": "\u023a\u0279\u01dd \u028e\u00f8n sn\u0279\u01dd \u028e\u00f8n \u028d\u1d09s\u0265 \u0287\u00f8 d\u01ddl\u01dd\u0287\u01dd \u0287\u0265\u1d09s \u1d09\u0287\u01dd\u026f. \u0197\u0287 \u0254\u0250nn\u00f8\u0287 b\u01dd \u0279\u01dd\u028c\u01dd\u0279s\u01ddd!\n\n\u023als\u00f8 \u0250n\u028e \u0254\u00f8n\u0287\u01ddn\u0287 \u0287\u0265\u0250\u0287 l\u1d09n\u029es/\u0279\u01dd\u025f\u01dd\u0279s \u0287\u00f8 \u0287\u0265\u1d09s \u1d09\u0287\u01dd\u026f \u028d\u1d09ll n\u00f8 l\u00f8n\u0183\u01dd\u0279 \u028d\u00f8\u0279\u029e (\u01dd.\u0183. b\u0279\u00f8\u029e\u01ddn \u1d09\u026f\u0250\u0183\u01dds \u0250nd/\u00f8\u0279 l\u1d09n\u029es)",
    "Are you sure?": "\u023a\u0279\u01dd \u028e\u00f8n sn\u0279\u01dd?",
    "As part of the verification process, you take a photo of both your face and a government-issued photo ID. Our authorization service confirms your identity by comparing the photo you take with the photo on your ID.": "\u023as d\u0250\u0279\u0287 \u00f8\u025f \u0287\u0265\u01dd \u028c\u01dd\u0279\u1d09\u025f\u1d09\u0254\u0250\u0287\u1d09\u00f8n d\u0279\u00f8\u0254\u01ddss, \u028e\u00f8n \u0287\u0250\u029e\u01dd \u0250 d\u0265\u00f8\u0287\u00f8 \u00f8\u025f b\u00f8\u0287\u0265 \u028e\u00f8n\u0279 \u025f\u0250\u0254\u01dd \u0250nd \u0250 \u0183\u00f8\u028c\u01dd\u0279n\u026f\u01ddn\u0287-\u1d09ssn\u01ddd d\u0265\u00f8\u0287\u00f8 \u0197\u0110. \u00d8n\u0279 \u0250n\u0287\u0265\u00f8\u0279\u1d09z\u0250\u0287\u1d09\u00f8n s\u01dd\u0279\u028c\u1d09\u0254\u01dd \u0254\u00f8n\u025f\u1d09\u0279\u026fs \u028e\u00f8n\u0279 \u1d09d\u01ddn\u0287\u1d09\u0287\u028e b\u028e \u0254\u00f8\u026fd\u0250\u0279\u1d09n\u0183 \u0287\u0265\u01dd d\u0265\u00f8\u0287\u00f8 \u028e\u00f8n \u0287\u0250\u029e\u01dd \u028d\u1d09\u0287\u0265 \u0287\u0265\u01dd d\u0265\u00f8\u0287\u00f8 \u00f8n \u028e\u00f8n\u0279 \u0197\u0110.",
    "As part of the verification process, you take a photo of both your face and a photo ID. Our authorization service confirms your identity by comparing the photo you take with the photo on your ID.": "\u023as d\u0250\u0279\u0287 \u00f8\u025f \u0287\u0265\u01dd \u028c\u01dd\u0279\u1d09\u025f\u1d09\u0254\u0250\u0287\u1d09\u00f8n d\u0279\u00f8\u0254\u01ddss, \u028e\u00f8n \u0287\u0250\u029e\u01dd \u0250 d\u0265\u00f8\u0287\u00f8 \u00f8\u025f b\u00f8\u0287\u0265 \u028e\u00f8n\u0279 \u025f\u0250\u0254\u01dd \u0250nd \u0250 d\u0265\u00f8\u0287\u00f8 \u0197\u0110. \u00d8n\u0279 \u0250n\u0287\u0265\u00f8\u0279\u1d09z\u0250\u0287\u1d09\u00f8n s\u01dd\u0279\u028c\u1d09\u0254\u01dd \u0254\u00f8n\u025f\u1d09\u0279\u026fs \u028e\u00f8n\u0279 \u1d09d\u01ddn\u0287\u1d09\u0287\u028e b\u028e \u0254\u00f8\u026fd\u0250\u0279\u1d09n\u0183 \u0287\u0265\u01dd d\u0265\u00f8\u0287\u00f8 \u028e\u00f8n \u0287\u0250\u029e\u01dd \u028d\u1d09\u0287\u0265 \u0287\u0265\u01dd d\u0265\u00f8\u0287\u00f8 \u00f8n \u028e\u00f8n\u0279 \u0197\u0110.",
    "As you complete courses, you will see them listed here.": "\u023as \u028e\u00f8n \u0254\u00f8\u026fdl\u01dd\u0287\u01dd \u0254\u00f8n\u0279s\u01dds, \u028e\u00f8n \u028d\u1d09ll s\u01dd\u01dd \u0287\u0265\u01dd\u026f l\u1d09s\u0287\u01ddd \u0265\u01dd\u0279\u01dd.",
