    "Before proceeding, please {htmlStart}unlink all social media accounts{htmlEnd}.": "\u0243\u01dd\u025f\u00f8\u0279\u01dd d\u0279\u00f8\u0254\u01dd\u01ddd\u1d09n\u0183, dl\u01dd\u0250s\u01dd {htmlStart}nnl\u1d09n\u029e \u0250ll s\u00f8\u0254\u1d09\u0250l \u026f\u01ddd\u1d09\u0250 \u0250\u0254\u0254\u00f8nn\u0287s{htmlEnd}.",
