    "EdX doesn\\'t have a timed transcript for this video. Please upload an .srt file.": "\u0246dX d\u00f8\u01ddsn\\'\u0287 \u0265\u0250\u028c\u01dd \u0250 \u0287\u1d09\u026f\u01ddd \u0287\u0279\u0250ns\u0254\u0279\u1d09d\u0287 \u025f\u00f8\u0279 \u0287\u0265\u1d09s \u028c\u1d09d\u01dd\u00f8. \u2c63l\u01dd\u0250s\u01dd ndl\u00f8\u0250d \u0250n .s\u0279\u0287 \u025f\u1d09l\u01dd.",
