    "Error: Connection with server failed.": "\u0246\u0279\u0279\u00f8\u0279: \u023b\u00f8nn\u01dd\u0254\u0287\u1d09\u00f8n \u028d\u1d09\u0287\u0265 s\u01dd\u0279\u028c\u01dd\u0279 \u025f\u0250\u1d09l\u01ddd.",
    "Error: Import failed.": "\u0246\u0279\u0279\u00f8\u0279: \u0197\u026fd\u00f8\u0279\u0287 \u025f\u0250\u1d09l\u01ddd.",
