    "Please check the following validation feedbacks and reflect them in your course settings:": "\u2c63l\u01dd\u0250s\u01dd \u0254\u0265\u01dd\u0254\u029e \u0287\u0265\u01dd \u025f\u00f8ll\u00f8\u028d\u1d09n\u0183 \u028c\u0250l\u1d09d\u0250\u0287\u1d09\u00f8n \u025f\u01dd\u01dddb\u0250\u0254\u029es \u0250nd \u0279\u01dd\u025fl\u01dd\u0254\u0287 \u0287\u0265\u01dd\u026f \u1d09n \u028e\u00f8n\u0279 \u0254\u00f8n\u0279s\u01dd s\u01dd\u0287\u0287\u1d09n\u0183s:",
