    "Please do not use any spaces or special characters in this field.": "\u2c63l\u01dd\u0250s\u01dd d\u00f8 n\u00f8\u0287 ns\u01dd \u0250n\u028e sd\u0250\u0254\u01dds \u00f8\u0279 sd\u01dd\u0254\u1d09\u0250l \u0254\u0265\u0250\u0279\u0250\u0254\u0287\u01dd\u0279s \u1d09n \u0287\u0265\u1d09s \u025f\u1d09\u01ddld.",
