    "Please note: Deletion of your account and personal data is permanent and cannot be undone. {platformName} will not be able to recover your account or the data that is deleted.": "\u2c63l\u01dd\u0250s\u01dd n\u00f8\u0287\u01dd: \u0110\u01ddl\u01dd\u0287\u1d09\u00f8n \u00f8\u025f \u028e\u00f8n\u0279 \u0250\u0254\u0254\u00f8nn\u0287 \u0250nd d\u01dd\u0279s\u00f8n\u0250l d\u0250\u0287\u0250 \u1d09s d\u01dd\u0279\u026f\u0250n\u01ddn\u0287 \u0250nd \u0254\u0250nn\u00f8\u0287 b\u01dd nnd\u00f8n\u01dd. {platformName} \u028d\u1d09ll n\u00f8\u0287 b\u01dd \u0250bl\u01dd \u0287\u00f8 \u0279\u01dd\u0254\u00f8\u028c\u01dd\u0279 \u028e\u00f8n\u0279 \u0250\u0254\u0254\u00f8nn\u0287 \u00f8\u0279 \u0287\u0265\u01dd d\u0250\u0287\u0250 \u0287\u0265\u0250\u0287 \u1d09s d\u01ddl\u01dd\u0287\u01ddd.",
    "Please provide a description of the link destination.": "\u2c63l\u01dd\u0250s\u01dd d\u0279\u00f8\u028c\u1d09d\u01dd \u0250 d\u01dds\u0254\u0279\u1d09d\u0287\u1d09\u00f8n \u00f8\u025f \u0287\u0265\u01dd l\u1d09n\u029e d\u01dds\u0287\u1d09n\u0250\u0287\u1d09\u00f8n.",
    "Please provide a valid URL.": "\u2c63l\u01dd\u0250s\u01dd d\u0279\u00f8\u028c\u1d09d\u01dd \u0250 \u028c\u0250l\u1d09d \u0244\u024c\u0141.",
    "Please re-enter your password.": "\u2c63l\u01dd\u0250s\u01dd \u0279\u01dd-\u01ddn\u0287\u01dd\u0279 \u028e\u00f8n\u0279 d\u0250ss\u028d\u00f8\u0279d.",
