    "Please select a file in .srt format.": "\u2c63l\u01dd\u0250s\u01dd s\u01ddl\u01dd\u0254\u0287 \u0250 \u025f\u1d09l\u01dd \u1d09n .s\u0279\u0287 \u025f\u00f8\u0279\u026f\u0250\u0287.",
