    "Type": "\u0166\u028ed\u01dd",
    "Type in a URL or use the \"Choose File\" button to upload a file from your machine. (e.g. 'http://example.com/img/clouds.jpg')": "\u0166\u028ed\u01dd \u1d09n \u0250 \u0244\u024c\u0141 \u00f8\u0279 ns\u01dd \u0287\u0265\u01dd \"\u023b\u0265\u00f8\u00f8s\u01dd F\u1d09l\u01dd\" bn\u0287\u0287\u00f8n \u0287\u00f8 ndl\u00f8\u0250d \u0250 \u025f\u1d09l\u01dd \u025f\u0279\u00f8\u026f \u028e\u00f8n\u0279 \u026f\u0250\u0254\u0265\u1d09n\u01dd. (\u01dd.\u0183. '\u0265\u0287\u0287d://\u01ddx\u0250\u026fdl\u01dd.\u0254\u00f8\u026f/\u1d09\u026f\u0183/\u0254l\u00f8nds.\u027ed\u0183')",
    "URL": "\u0244\u024c\u0141",
    "Unable to delete account": "\u0244n\u0250bl\u01dd \u0287\u00f8 d\u01ddl\u01dd\u0287\u01dd \u0250\u0254\u0254\u00f8nn\u0287",
    "Unable to determine whether we should give you a refund because of System Error. Please try again later.": "\u0244n\u0250bl\u01dd \u0287\u00f8 d\u01dd\u0287\u01dd\u0279\u026f\u1d09n\u01dd \u028d\u0265\u01dd\u0287\u0265\u01dd\u0279 \u028d\u01dd s\u0265\u00f8nld \u0183\u1d09\u028c\u01dd \u028e\u00f8n \u0250 \u0279\u01dd\u025fnnd b\u01dd\u0254\u0250ns\u01dd \u00f8\u025f S\u028es\u0287\u01dd\u026f \u0246\u0279\u0279\u00f8\u0279. \u2c63l\u01dd\u0250s\u01dd \u0287\u0279\u028e \u0250\u0183\u0250\u1d09n l\u0250\u0287\u01dd\u0279.",
    "Unable to get report generation status.": "\u0244n\u0250bl\u01dd \u0287\u00f8 \u0183\u01dd\u0287 \u0279\u01ddd\u00f8\u0279\u0287 \u0183\u01ddn\u01dd\u0279\u0250\u0287\u1d09\u00f8n s\u0287\u0250\u0287ns.",
    "Unable to submit application": "\u0244n\u0250bl\u01dd \u0287\u00f8 snb\u026f\u1d09\u0287 \u0250ddl\u1d09\u0254\u0250\u0287\u1d09\u00f8n",
    "Unable to submit request to generate report.": "\u0244n\u0250bl\u01dd \u0287\u00f8 snb\u026f\u1d09\u0287 \u0279\u01ddbn\u01dds\u0287 \u0287\u00f8 \u0183\u01ddn\u01dd\u0279\u0250\u0287\u01dd \u0279\u01ddd\u00f8\u0279\u0287.",
