    "Upgrade All Remaining Courses (": "\u0244d\u0183\u0279\u0250d\u01dd \u023all \u024c\u01dd\u026f\u0250\u1d09n\u1d09n\u0183 \u023b\u00f8n\u0279s\u01dds (",
