    "What is the highest level of education that any of your parents or guardians have achieved?": "W\u0265\u0250\u0287 \u1d09s \u0287\u0265\u01dd \u0265\u1d09\u0183\u0265\u01dds\u0287 l\u01dd\u028c\u01ddl \u00f8\u025f \u01dddn\u0254\u0250\u0287\u1d09\u00f8n \u0287\u0265\u0250\u0287 \u0250n\u028e \u00f8\u025f \u028e\u00f8n\u0279 d\u0250\u0279\u01ddn\u0287s \u00f8\u0279 \u0183n\u0250\u0279d\u1d09\u0250ns \u0265\u0250\u028c\u01dd \u0250\u0254\u0265\u1d09\u01dd\u028c\u01ddd?",
